import React from "react";
import { getCurrentWeather } from "../api";

function CurrentWeather() {
  const data = getCurrentWeather();
  const {
    cloud_cover,
    feels_like,
    humidity,
    icon_num,
    precipitation,
    summary,
    temperature,
    uv_index,
    visibility,
    wind,
  } = data;
  return <div className="CurrentWeather">CurrentWeather</div>;
}

export default CurrentWeather;
